                        <Route path={`${match.url}/standard`}   component={render=> <Standard />}  />
                        <Route path={`${match.url}/tshirt`}     component={render=> <Tshirts />}  />
                        <Route path={`${match.url}/trousers`}   component={render=> <Trousers />}  />
                        <Route path={`${match.url}/sleepwear`}  component={render=> <Sleepwere />}  />
                        <Route path={`${match.url}/sandals`}    component={render=> <Sandels />}  />
                        <Route path={`${match.url}/loafers`}    component={render=> <Loafers />}  />

                    </div>
                </Router>
            </div>
        );
}


